import{_ as e,o as t,c as o,R as a}from"./chunks/framework.6Daji7ki.js";const m=JSON.parse('{"title":"Contributor Covenant Code of Conduct","description":"","frontmatter":{},"headers":[],"relativePath":"code_of_conduct.md","filePath":"code_of_conduct.md"}'),n={name:"code_of_conduct.md"},r=a('<h1 id="contributor-covenant-code-of-conduct" tabindex="-1">Contributor Covenant Code of Conduct <a class="header-anchor" href="#contributor-covenant-code-of-conduct" aria-label="Permalink to &quot;Contributor Covenant Code of Conduct&quot;">​</a></h1><h2 id="our-pledge" tabindex="-1">Our Pledge <a class="header-anchor" href="#our-pledge" aria-label="Permalink to &quot;Our Pledge&quot;">​</a></h2><p>In the interest of fostering an open and welcoming environment, we as contributors and maintainers pledge to making participation in our project and our community a harassment-free experience for everyone, regardless of age, body size, disability, ethnicity, gender identity and expression, level of experience, nationality, personal appearance, race, religion, or sexual identity and orientation.</p><h2 id="our-standards" tabindex="-1">Our Standards <a class="header-anchor" href="#our-standards" aria-label="Permalink to &quot;Our Standards&quot;">​</a></h2><p>Examples of behavior that contributes to creating a positive environment include:</p><ul><li>Using welcoming and inclusive language</li><li>Being respectful of differing viewpoints and experiences</li><li>Gracefully accepting constructive criticism</li><li>Focusing on what is best for the community</li><li>Showing empathy towards other community members</li></ul><p>Examples of unacceptable behavior by participants include:</p><ul><li>The use of sexualized language or imagery and unwelcome sexual attention or advances</li><li>Trolling, insulting/derogatory comments, and personal or political attacks</li><li>Public or private harassment</li><li>Publishing others&#39; private information, such as a physical or electronic address, without explicit permission</li><li>Other conduct which could reasonably be considered inappropriate in a professional setting</li></ul><h2 id="our-responsibilities" tabindex="-1">Our Responsibilities <a class="header-anchor" href="#our-responsibilities" aria-label="Permalink to &quot;Our Responsibilities&quot;">​</a></h2><p>Project maintainers are responsible for clarifying the standards of acceptable behavior and are expected to take appropriate and fair corrective action in response to any instances of unacceptable behavior.</p><p>Project maintainers have the right and responsibility to remove, edit, or reject comments, commits, code, wiki edits, issues, and other contributions that are not aligned to this Code of Conduct, or to ban temporarily or permanently any contributor for other behaviors that they deem inappropriate, threatening, offensive, or harmful.</p><h2 id="scope" tabindex="-1">Scope <a class="header-anchor" href="#scope" aria-label="Permalink to &quot;Scope&quot;">​</a></h2><p>This Code of Conduct applies both within project spaces and in public spaces when an individual is representing the project or its community. Examples of representing a project or community include using an official project email address, posting via an official social media account, or acting as an appointed representative at an online or offline event. Representation of a project may be further defined and clarified by project maintainers.</p><h2 id="enforcement" tabindex="-1">Enforcement <a class="header-anchor" href="#enforcement" aria-label="Permalink to &quot;Enforcement&quot;">​</a></h2><p>Instances of abusive, harassing, or otherwise unacceptable behavior may be reported by contacting the project team at <a href="mailto:hyattherate2005@gmail.com" target="_blank" rel="noreferrer">hyattherate2005@gmail.com</a>. All complaints will be reviewed and investigated, and will result in a response that is deemed necessary and appropriate to the circumstances. The project team is obligated to maintain confidentiality with regard to the reporter of an incident. Further details of specific enforcement policies may be posted separately.</p><p>Project maintainers who do not follow or enforce the Code of Conduct in good faith may face temporary or permanent repercussions as determined by other members of the project&#39;s leadership.</p><h2 id="attribution" tabindex="-1">Attribution <a class="header-anchor" href="#attribution" aria-label="Permalink to &quot;Attribution&quot;">​</a></h2><p>This Code of Conduct is adapted from the <a href="https://www.contributor-covenant.org" target="_blank" rel="noreferrer">Contributor Covenant</a>, version 2.0, available at <a href="https://www.contributor-covenant.org/version/2/0/code_of_conduct.html" target="_blank" rel="noreferrer">https://www.contributor-covenant.org/version/2/0/code_of_conduct.html</a>.</p><p>For answers to common questions about this code of conduct, see <a href="https://www.contributor-covenant.org/faq" target="_blank" rel="noreferrer">https://www.contributor-covenant.org/faq</a>.</p><p>Thank you for contributing and helping to make this project a welcoming and respectful space for everyone!</p>',20),i=[r];function c(s,l,d,p,h,u){return t(),o("div",null,i)}const b=e(n,[["render",c]]);export{m as __pageData,b as default};
